import axios from 'axios';



const getProductData = () => {
  return axios.get('http://localhost:4000')
}

class App extends Component {

  render() {
    axios.get('http://localhost:4000/getData01') //truy cập đến đường dẫn
      .then(function (response) {
        // handle success
        console.log(response.data);
      })
      .catch(function (error) {
        // handle error
        console.log(error);
      })
      .finally(function () {
        // always executedy
      });
    return (
      <div className="App">
        <Headtitle />

        <div className="container">
          <div className="row">
            <Product />
            <Product />
            <Product />
            <Product />
            <Product />

          </div>
        </div>
      </div>
    );
  }
}

export default App;
